INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/01/31 12:00:00", 1, 190801, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "2030/01/01 14:59:59", 64, 0.0, "カリン", -363.0, 1000005, 5, 2.12, 1, 2);
