INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/01/31 12:00:00", 1, 190801, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "2030/01/01 14:59:59", 64, 0.0, "カリン", -363.0, 1000007, 7, 2.33, 1, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/01/31 12:00:00", 10201, 133701, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "2030/01/01 14:59:59", 61, -6.0, "ラビリスタ", -285.0, 1020101, 101, 5.18, 7, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/01/31 12:00:00", 10201, 133901, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "2030/01/01 14:59:59", 61, -2.0, "クリスティーナ", -285.0, 1020102, 201, 8.77, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/01/31 12:00:00", 10201, 133801, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "2030/01/01 14:59:59", 61, 0.0, "ネネカ", -285.0, 1020103, 301, 15.5, 1, 6);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/02/28 12:00:00", 10202, 134301, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "2030/01/01 14:59:59", 61, 0.0, "ランファ", -285.0, 1020201, 101, 9.061, 5, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/02/28 12:00:00", 10202, 134401, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "2030/01/01 14:59:59", 61, 0.0, "チカ", -285.0, 1020202, 201, 7.699, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/03/31 12:00:00", 10203, 134601, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "2030/01/01 14:59:59", 61, 0.0, "アオイ", -285.0, 1020301, 101, 8.595, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/03/31 12:00:00", 10203, 134501, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "2030/01/01 14:59:59", 61, 0.0, "クローチェ", -285.0, 1020302, 201, 7.758, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/04/30 12:00:00", 10204, 132302, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", "2030/01/01 14:59:59", 61, 0.0, "ルイズマリー", -285.0, 1020401, 101, 7.0, 6, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/04/30 12:00:00", 10204, 132402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", "2030/01/01 14:59:59", 61, 0.0, "イロハ", -285.0, 1020402, 201, 7.904, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/04/30 12:00:00", 10204, 132502, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", "2030/01/01 14:59:59", 61, 0.0, "ソノ", -285.0, 1020403, 301, 8.487, 2, 4);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/05/31 12:00:00", 10205, 134901, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", "2030/01/01 14:59:59", 61, 0.0, "カノン", -285.0, 1020502, 101, 8.763, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/05/31 12:00:00", 10205, 134801, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", "2030/01/01 14:59:59", 61, 0.0, "ツムギ", -285.0, 1020503, 201, 6.417, 3, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/06/30 12:00:00", 10206, 135001, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", "2030/01/01 14:59:59", 61, 0.0, "エリス", -285.0, 1020601, 101, 10.335, 7, 3);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/06/30 12:00:00", 10206, 135101, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", "2030/01/01 14:59:59", 61, 0.0, "シェフィ", -285.0, 1020602, 201, 6.281, 4, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/06/30 12:00:00", 10206, 135201, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", "2030/01/01 14:59:59", 61, 0.0, "プレシア", -285.0, 1020603, 301, 12.244, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/07/31 12:00:00", 10207, 135301, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", "2030/01/01 14:59:59", 61, 0.0, "クリア", -285.0, 1020701, 101, 6.339, 8, 2);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/07/31 12:00:00", 10207, 135401, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", "2030/01/01 14:59:59", 61, 0.0, "アネモネ", -285.0, 1020702, 201, 8.184, 9, 7);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/08/31 12:00:00", 10208, 129101, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", "2030/01/01 14:59:59", 61, 0.0, "アイラ", -285.0, 1020801, 101, 3.906, 2, 9);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/08/31 12:00:00", 10208, 129201, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", "2030/01/01 14:59:59", 61, 0.0, "シナツ", -285.0, 1020802, 201, 14.465, 2, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/08/31 12:00:00", 10208, 100101, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", "2030/01/01 14:59:59", 61, 0.0, "ヒヨリ", -285.0, 1020803, 301, 8.662, 3, 4);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/08/31 12:00:00", 10208, 100301, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", "2030/01/01 14:59:59", 61, 0.0, "レイ", -285.0, 1020804, 401, 10.915, 3, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/09/30 12:00:00", 10209, 135802, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", "2030/01/01 14:59:59", 61, 0.0, "ユキノ", -285.0, 1020901, 101, 6.042, 7, 1);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/09/30 12:00:00", 10209, 135903, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", "2030/01/01 14:59:59", 61, 0.0, "サツキ", -285.0, 1020902, 201, 9.402, 1, 4);
INSERT INTO `v1_59f86ba18e651a773180a0bf7f38a7caf37cc1cbda0efbf5714a2a31557da82c` VALUES ("2025/09/30 12:00:00", 10209, 136902, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", "2030/01/01 14:59:59", 61, 0.0, "ルルィ", -285.0, 1020903, 301, 8.16, 1, 8);
